def parse_input(input_data):
    return [list(line) for line in input_data.strip().splitlines()]

def calculate_region_price(grid):
    rows, cols = len(grid), len(grid[0])
    visited = set()

    def is_valid(x, y):
        return 0 <= x < rows and 0 <= y < cols

    def flood_fill(x, y, plant_type):
        stack = [(x, y)]
        region_cells = []
        region_edges = 0

        while stack:
            cx, cy = stack.pop()
            if (cx, cy) in visited:
                continue

            visited.add((cx, cy))
            region_cells.append((cx, cy))

            # Calculate edges for the current cell
            for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nx, ny = cx + dx, cy + dy
                if not is_valid(nx, ny) or grid[nx][ny] != plant_type:
                    region_edges += 1
                elif (nx, ny) not in visited:
                    stack.append((nx, ny))

        return len(region_cells), region_edges

    total_price = 0

    for i in range(rows):
        for j in range(cols):
            if (i, j) not in visited:
                plant_type = grid[i][j]
                area, sides = flood_fill(i, j, plant_type)
                total_price += area * sides

    return total_price

def main(input_data):
    grid = parse_input(input_data)
    return calculate_region_price(grid)

